NOTE.Documentation_plain:
Rcupre les valeurs des paramtres 'nrmId' et 'lnsServiceToDelete' dans la table CMD_PARAMETRES.
Si la valeur du paramtre 'lnsServiceToDelete' est vide, on retourne 'RAF',
sinon, appel  la procdure stocke de CS0 : :ret := CS.delete_lns_from_user(:userId, :nrmId);

Utilise la valeur du paramtre 'nrmId' de la table CMD_PARAMETRES.
Fait appel  la procdure stocke de CS0: :ret := CS.get_attributes_from_nrmid( :userId, :nrmId, :serviceName, :curs ); 
Cre ou met  jour la valeur du paramtre 'lnsServiceToDelete' dans la table CMD_PARAMETRES.
